import styled from 'styled-components';

const ImageWrapper = styled.section`
    width: 100%;
    height: 100%;
    position: relative;
    overflow: hidden;
`;

export default function HomeBackground() {
    return (
        <div>

            <h1>Tell everyone about the twists and turns in your journey</h1>


            <img src="img/person.png" alt="" className='landingPage-photo'></img>
            <img src="img/mountain1.png" alt="" className='landingPage-photo'></img>
            <img src="img/moutain2.png" alt="" className='landingPage-photo'></img>
            <img src="img/mountain3.png" alt="" className='landingPage-photo'></img>
            <img src="img/sky.png" alt="" className='landingPage-photo'></img>

        </div>
    )
}
